import React from 'react';
import { NavLink } from 'react-router-dom';
import Logo from '../../logoHenry.png'

import './Navbar.css';

export default function NavBar() {
    return (
        <header className="navbar">
            <div>
                <img id="logoHenry" src={Logo} width="30" height="30" className="d-inline-block align-top" alt="" />
            </div>
            <nav>
                <ul className="list">
                    <li className="list-item">
                        <NavLink style={{margin: 5,  textDecoration: "none", fontFamily: "Oxygen", marginTop: 40}} exact to="/" >Home</NavLink>
                    </li>
                    <li className="list-itemb">
                        <NavLink style={{margin: 5, textDecoration: "none", fontFamily: "Oxygen"}} to="/favs" >Favourites</NavLink>
                    </li>        
                </ul>
            </nav>
        </header>
    )
}
